import React from "react";
import ReactDOM from "react-dom";

const fname  = "pgllluuu";
const lname = "sharma";
const dateToday = new Date().toLocaleDateString();
const timeCurrent = new Date().toLocaleTimeString();
const img1 = "https://picsum.photos/250/300";
const img2 = "https://picsum.photos/200/250";
const img3 = "https://picsum.photos/240/330";
const links = 'https://www.thapatechnical.com';
ReactDOM.render(
    <div>
       <h1>my name is {` ${fname} ${lname}`}</h1>
       <h2>{`today date is  : ${dateToday}`}</h2>
       <h3>{`current time ${timeCurrent} `}</h3>
      <img src = {img1} alt="randomImages" />
      <img src = {img2} alt="randomImages" />
      <a href={links} target="_">
      <img src = {img3} alt="randomImages" />
      </a>
    </div>,
    document.getElementById("root")
);
